import { Link, useNavigate, useLocation } from "react-router-dom";
import { useState } from "react";
import { DebounceInput } from "react-debounce-input";
// import MobileMenu from "./MobileMenu"; // Ensure you have this component

const Navbar = ({ setSearchQuery }) => {
  const location = useLocation();
  const navigate = useNavigate();
  const [mobileMenuStatus, setMobileMenuStatus] = useState(false);

  const logoutHandler = () => {
    // Add your logout logic here
  };

  return (
    <nav style={styles.nav}>
      <div style={styles.mobileHeader}>
        <i
          className="material-icons mobile-menu-icon"
          onClick={() => setMobileMenuStatus((prev) => !prev)}
        >
          menu
        </i>
        <div style={styles.navMobileBrand}>
          <Link to="/" style={styles.link}>
            Agro<span style={styles.darkBrownColor}>Stores</span>
          </Link>
        </div>
      </div>
      <div style={styles.navBrand}>
        <Link to="/" style={styles.link}>
          Agro<span style={styles.darkBrownColor}>Stores</span>
        </Link>
      </div>

      <div style={styles.searchField}>
        <i className="material-icons" style={styles.searchIcon}>
          search
        </i>
        <DebounceInput
          minLength={2}
          debounceTimeout={500}
          type="text"
          name="search-bar"
          id="search-bar"
          placeholder="Search"
          onClick={() => navigate("/search")}
          onChange={(e) => setSearchQuery(e.target.value)}
          autoFocus={location.pathname === "/search"}
          style={styles.searchInput}
        />
      </div>

      <ul style={styles.navPills}>
        <li>
          <button style={styles.btn} onClick={logoutHandler}>
            Logout
          </button>
        </li>
        <li>
          <Link to="/wishlist" style={styles.link}>
            <i className="material-icons" style={styles.icon}>
              favorite
            </i>
            <span style={styles.badgeCount}>0</span> {/* Placeholder */}
          </Link>
        </li>
        <li>
          <Link to="/cart" style={styles.link}>
            <i className="material-icons" style={styles.icon}>
              shopping_cart
            </i>
            <span style={styles.badgeCount}>0</span> {/* Placeholder */}
          </Link>
        </li>
        <li>
          <Link to="/profile" style={styles.link}>
            <i className="material-icons" style={styles.icon}>
              account_circle
            </i>
          </Link>
        </li>
      </ul>
      {/* <MobileMenu
        mobileMenuStatus={mobileMenuStatus}
        setMobileMenuStatus={setMobileMenuStatus}
        logoutHandler={logoutHandler}
        wishlistItemsCount={0} // Placeholder
        cartItemsCount={0} // Placeholder
      /> */}
    </nav>
  );
};

const styles = {
  nav: {
    display: 'flex',
    flexWrap: 'wrap',
    height: '5rem',
    justifyContent: 'space-around',
    padding: '0.5rem 0',
    backgroundImage: 'linear-gradient(120deg, #84fab0 0%, #8fd3f4 100%)',
    fontFamily: 'var(--acme-font)',
  },
  mobileHeader: {
    display: 'none',
  },
  navMobileBrand: {
    fontSize: '1.2rem',
  },
  navBrand: {
    fontSize: '1.5rem',
  },
  link: {
    textDecoration: 'none',
    color: 'var(--primary)',
  },
  darkBrownColor: {
    color: 'var(--dark-brown)',
  },
  searchField: {
    position: 'relative',
    width: '18.75rem',
    backgroundColor: 'var(--white)',
  },
  searchIcon: {
    position: 'absolute',
    top: '20%',
    right: '2%',
  },
  searchInput: {
    border: 'none',
    height: '2.5rem',
    width: '85%',
    fontSize: '1.2rem',
    padding: '0rem 0.5rem',
    borderRadius: '5px',
    border: '2px solid var(--primary)',
  },
  navPills: {
    display: 'flex',
    listStyleType: 'none',
    alignItems: 'center',
    fontWeight: 'bold',
  },
  btn: {
    width: '6rem',
    fontSize: '1.1rem',
    padding: '0.5rem 1.75rem',
    background: 'none',
    border: 'none',
    cursor: 'pointer',
  },
  icon: {
    fontSize: '2rem',
    cursor: 'pointer',
  },
  badgeCount: {
    marginLeft: '0.5rem',
  },
};

export default Navbar;
